import React from 'react'
import Link from 'next/link'

const footer = () => {
    return (
        <div className='bg-gray-600 p-4'>
            <div className='container mx-auto text-center font-bold margin-botom'>
                Desenvolvido por Airton Diniz
                <img src='/nasa.png' />
            </div>
        </div>
    )
}
export default footer
